column922:
La campul [AFp3_tip] nu am bifat nimic deoarece titularul a declarat "avocat asociat" - nu pot defini incadrarea, banuiesc ca 2 dar trebuie vazut; tot la AFp3- nu este declarata valoarea participatiei de 50% in cabinetul de avocatura; insa la venituri titularul declara 42147,49 venituri anuale(regula simpla pt evaluare cabinete de avocatura = venitul pe ultimii 5 ani x 2)
Campurile [dat2_cred] si [dat5_cred] deasemenea necompletate, nu este specificat creditorul;
Observatie: titularul are credite acordate de banci in valoare de 123.000 EUR si 90.000 RON ; cu ce o fi garantat (colateral) deoarece nu detine nici un fel de bunuri imobile, doar cateva ceasuri si bijuterii. 
